INSERT INTO `news_message` VALUES (97,'日常管理','办公室管理（制度制定及执行）、考勤管理、人员优化、招聘；员工档案，培训管理；保险、卫生、水电、办公用品、电话使用、、值班等、ISO管理监督推行、执行公司规章制度，考核各部门（财务，采购，市场，厂长，仓库，质量，安全；监督各部门工作进展',1,'2015-11-25 02:25:54'),(98,'制度通知','李长旭：规划公司制度，考核制度；\r\n人事管理，保持优秀人员稳定。制定公司培训计划，定期对后勤人员进行培训管理，树立公司文化；ISO管理监督推行、执行公司规章制度，监督各部门工作进展；灵活公关各客户及政府部门；善于组织、协调，团结各部门协调工作，公司制度有力执行，下情及时上达。',1,'2015-11-25 02:27:18'),(99,'办公管理','办公室管理（制度制定及执行）、考勤管理、人员优化、招聘；员工档案，培训管理；保险、卫生、水电、办公用品、电话使用、、值班等、ISO管理监督推行、执行公司规章制度，考核各部门（财务，采购，市场，厂长，仓库，质量，安全；监督各部门工作进展。',1,'2015-11-25 02:28:37'),(100,'生产指南','生产班组要为厂部负责1、为该班组产品质量，安全生产完全责任人，组织本班组人员进行“质量第一，安全第一”的思想教育，2、根据当天的生产情况，布置当天的工作安排及工作要求，3、组织生产工人学习操作规范，严格按照工艺规程各规位职责执行，保质保量的完成生产任务，4、对当班生产线的技术问',1,'2015-11-25 02:29:23'),(103,'办公室管理','办公室管理（制度制定及执行）、考勤管理、人员优化、招聘；员工档案，培训管理；保险、卫生、水电、办公用品、电话使用、、值班等、ISO管理监督推行、执行公司规章制度，考核各部门（财务，采购，市场，厂长，仓库，质量，安全；监督各部门工作进展',1,'2016-01-27 02:08:47'),(104,'办公室管理','办公室管理（制度制定及执行）、考勤管理、人员优化、招聘；员工档案，培训管理；保险、卫生、水电、办公用品、电话使用、、值班等、ISO管理监督推行、执行公司规章制度，考核各部门（财务，采购，市场，厂长，仓库，质量，安全；监督各部门工作进展',1,'2016-01-27 02:09:00');
