INSERT INTO `news_news` VALUES (41,'山西省委书记王儒林在太重调研','<div><br></div><div><p style=\"padding: 0px; margin-bottom: 0px; color: rgb(84, 83, 83); line-height: 24px; letter-spacing: 0.5px; text-indent: 25px; font-family: SimSun; font-size: 12px; background-color: rgb(236, 242, 247);\">8月4日，山西省委书记王儒林深入太重，就太重经营现状和发展对策进行调研。他强调，太重要把科技创新、全面创新作为企业应对经济下行压力、实现转型升级的战略举措，不断增强企业活力和竞争力，在我省非煤产业发展这篇大文章中发挥示范作用。省委常委、秘书长王伟中参加调研。集团公司党委书记、董事长王创民，党委常委、副董事长、总经理张志德，党委副书记丁永平，党委常委、纪委书记王敏陪同调研。<br></p><p style=\"padding: 0px; margin-bottom: 0px; color: rgb(84, 83, 83); line-height: 24px; letter-spacing: 0.5px; text-indent: 25px; font-family: SimSun; font-size: 12px; background-color: rgb(236, 242, 247);\">王儒林一行首先来到太重展览馆，详细了解太重的发展历史和主要产品板块，不时询问太重拳头产品在国内国际市场所处的地位。随后，王儒林考察了矿山设备分公司和起重机分公司的生产现场，并详细询问了企业经营状况、职工收入等情况。考察中，王创民汇报了太重在“新常态”下的转型发展情况。太重深化产品结构调整、推进国际化发展的战略举措得到王儒林的充分肯定。</p><p style=\"padding: 0px; margin-bottom: 0px; color: rgb(84, 83, 83); line-height: 24px; letter-spacing: 0.5px; text-indent: 25px; font-family: SimSun; font-size: 12px; background-color: rgb(236, 242, 247);\">王儒林强调，煤与非煤是当前山西经济发展的两篇大文章，尤其是在非煤产业中，装备制造业的发展被寄予厚望。太重作为我国装备制造业的龙头，在很多方面拥有不可替代的优势，要在我省加快发展装备制造业中发挥好示范作用，促进装备制造业成为我省新的经济增长点。</p><p style=\"padding: 0px; margin-bottom: 0px; color: rgb(84, 83, 83); line-height: 24px; letter-spacing: 0.5px; text-indent: 25px; font-family: SimSun; font-size: 12px; background-color: rgb(236, 242, 247);\">王儒林强调，当前经济下行压力仍在加大，我省企业效益普遍下滑，面临的困难前所未有。太重要坚定信心，化挑战为机遇，坚持把科技创新、全面创新摆在核心位置，继续提高产品高端化、配套化水平，提高资本运作水平，加快转型升级，降本挖潜增效。太重还要积极对接国家“一带一路”战略，拓展国外市场，提高企业国际竞争力，推动企业持续健康发展。（牛帅）</p></div>','2015-11-20',2),(42,'特大型铸件浇铸成功','<p style=\"padding: 0px; margin-bottom: 0px; color: rgb(84, 83, 83); line-height: 24px; letter-spacing: 0.5px; text-indent: 25px; font-family: SimSun; font-size: 12px; background-color: rgb(236, 242, 247);\">日前，我公司浇铸成功特大的立柱型铸件，该铸件重量达565吨，采用5个钢包同时浇铸，使用的钢水重量达到935吨，这个重量创新了大型铸件的世界纪录。</p><p style=\"padding: 0px; margin-bottom: 0px; color: rgb(84, 83, 83); line-height: 24px; letter-spacing: 0.5px; text-indent: 25px; font-family: SimSun; font-size: 12px; background-color: rgb(236, 242, 247);\">该立柱型铸件的外形尺寸：11.5米x7.5米x4.4米，为我公司35000吨多向模锻压机配套生产。</p>','2015-11-11',2),(43,'160万吨焦化总承包项目进展顺利','    \"在此编写新闻内容...\"  ','2015-11-18',1),(45,'太重亮相印度钢铁国际展会','    \"在此编写新闻内容...\"  ','2015-11-12',2),(46,'特大型锻件锻造成功','    \"在此编写新闻内容...\"  ','2015-11-18',2),(48,'公司领导慰问一线职工','    \"在此编写新闻内容...\"  ','2015-11-11',1),(49,'全球最大520吨铸造起重机出厂验收','    \"在此编写新闻内容...\"  ','2015-11-12',1),(50,'35m³挖掘机再次出口南非','    \"在此编写新闻内容...\"  ','2015-11-14',1),(51,'test','<img src=\"data:image/jpeg;base64,','2016-05-09',1);
/*!40000 ALTER TABLE `news_news` ENABLE KEYS */;
