INSERT INTO `purchasing_materielexecute` VALUES (19,'213',2,'2016-01-19','main_materiel',1,NULL,NULL),(20,'321',2,'2015-11-08','support_materiel',0,NULL,NULL),(21,'1234',2,'2016-05-05','main_materiel',1,'飞飞飞','123\n324\n678\n456'),(25,'435643643',2,'2016-05-12','main_materiel',1,NULL,'234234234'),(26,'452345235',2,'2016-01-21','main_materiel',0,NULL,NULL),(27,'3464574645',2,'2016-01-21','main_materiel',0,NULL,NULL),(28,'03014001-主10',2,'2016-01-23','main_materiel',1,NULL,'说明： 1.△表示一般受压件,△△表示主要受压件。\n            2.F表示回厂复验。\n技术要求：\n（1）每张钢板都应附带材质证明书原件。\n（2）15CrMoR钢板必须由舞钢提供。Q345R钢板由武钢、首钢、包钢、太钢、舞钢提供。\n（3）序号1、序号2、序号3和序号4的15CrMoR钢板还应满足以下条件：\n     ①钢板应采用电炉或氧气转炉加真空精炼的镇静钢；钢板中非金属夹杂物应按GB/T10561-2005进行检验：A、B、C、D及DS类夹杂物均不大于1.5级，A+C类夹杂物不大于2.5级，B+D+DS类夹杂物不大于2.5级，且总和不大于4.5级；钢板的晶粒度要求不低于5级，按GB/T6394-2002中的规定检测。\n     ②15CrMoR钢板按炉批号复验化学成分：P，S含量（wt%）分别≤0.015%和≤0.010%；逐张复验力学性能和冷弯性能（包括模拟焊后热处理的-其中夏比V型缺口冲击试验，断后伸长率A以及冷弯为Min.PWHT和Max.PWHT两种工况），其中钢板冲击试验的温度为0℃，取样位置为t/2和t/4处，冲击功及其他要求按GB713-2014中的规定，以上结果都应符合GB713-2014中的规定。逐张复验高温拉伸性能（包括Max.PWHT模拟焊后热处理后的），试验温度为480℃，试验温度下的屈服强度不低于GB713-2014中规定的数值。\n     ③制造厂应对15CrMoR钢板逐张进行100%超声检测（100%扫查）及测厚检查，超声检测按JB/T4730.3-2005中Ⅰ级合格。');
