INSERT INTO `techdata_transfercardprocess` VALUES (419,15,'1','预 备','认真核对钢板的材质、规格，并移植材质标记，不许打钢印'),(420,15,'2','切 割','采用数控切割，均分两端下料，1/2下料尺寸：-46×2364-4214(宽度2364两端各含5mm加工余量，长度4214两端各含150mm压头余量)，保证对角线公差不超过2mm'),(421,15,'3','修 磨','割后清除熔渣、毛刺及氧化皮等'),(422,15,'4','划 线','按筒体理论展开长划压头切割线及压制线，并在压头切割线上打样冲'),(423,15,'5','压 头','根据环缝坡口形式确定压弯方向，压制弧度，并用样板检测压制弧度，间隙≤2mm'),(424,15,'6','切 割','封头回厂后确定筒体实际展开长，划出实际压头切割线，用半自动切割机割压头余量，并开对接坡口'),(425,15,'7','修 磨','割后清除熔渣、毛刺及氧化皮等，使其呈现金属光泽，坡口表面不得有裂纹、分层、夹杂等缺陷'),(426,15,'8','探 伤','坡口表面按JB/T4730.4-2005《压力容器无损检测》标准进行100% MT检测，Ⅰ级合格'),(427,15,'9','圈 圆','在中三辊上卷制圆筒，并用样板检测压制弧度，间隙≤2mm'),(428,15,'10','对 接','10.1 纵缝对口错边量b≤2mm，外圆周长允差-3mm≤C≤6mm 10.2 清理坡口两侧表面30mm范围内的氧化物、油污、熔渣、及其它影响焊缝质量的有害杂质'),(429,15,'11','焊 接','筒体纵缝A2、A3的装配点焊与焊接均执行RH09-015007B焊接工艺指导书，并与纵缝焊接试板一同焊接，焊接产品试板执行R05-015007B- -01《压力容器产品试板工艺卡（流转）》'),(430,15,'12','探 伤','对焊接试板进行鉴证。'),(431,15,'13','切 割','将试板从筒体上切割下来，不得伤及筒体，试板交试板库'),(432,15,'14','修 磨','割后清除熔渣、毛刺及氧化皮等'),(433,15,'15','校 圆','用样板检查纵缝处所形成的棱角，E≤3mm；同一断面的最大最小直径差e≤3mm'),(434,15,'16','探 伤','纵缝按JB/T4730-2005《压力容器无损检测》标准进行100% RT检测，Ⅱ级合格，技术等级为AB级；合格后进行≥20%UT检测，Ⅰ级合格，技术等级为B级；焊缝内外表面100%MT检测，Ⅰ级合格'),(435,15,'17','修 磨','使焊缝与母材光滑过渡，焊缝余高不得高于3mm'),(436,15,'18','坡 口','检验合格后按图纸要求机加工出环缝坡口及过渡段（加工坡口前筒体上下端需加工装支撑）。'),(437,15,'19','修 磨','加工后清除毛刺及油污等，坡口表面不得有裂纹、分层、夹杂等缺陷。'),(438,15,'20','探 伤','坡口按JB/T4730-2005《压力容器无损检测》标准执行100% MT检测，I级合格。'),(439,15,'21','入 库','筒体及试板经检验合格后筒体入半成品库。'),(440,16,'1','下  料','1.1  下料前认真核对钢板的材质、规格，热处理状态，并移植材质标记（不许打钢印）          1.2  封头坯料尺寸 -34×D1850'),(441,16,'2','数控切割','切割坯料外圆，切割前预热 120℃，割后清除熔渣，毛刺等，与R3041.05共带一块母材试板'),(442,16,'3','热压','对封头毛坯热压成形（外协）。'),(443,16,'4','热处理','封头进行恢复材料状态的正火热处理，注意与R3041.05同炉热处理，热处理后母材试板进行力学性能试验，实验结果确认合格后，将部分试板回厂，经复验合格后，再按图纸加工好坡口（外协）。剩余试板随封头回厂。'),(444,16,'5','检 查','5.1.封头表面凹凸量  -6～+12mm；5.2. 封头最小壁厚不得小于27.7mm；      5.3.封头主要尺寸允差见下表规定:大口内直径允差：-4～+5；总高度公差：-3～+4；大口外圆周长公差：-12～+15；大小口同心度：≤2mm。'),(445,16,'6','入 库','检验及试板性能合格后入库。'),(446,17,'1','下  料','1.1  下料前认真核对钢板的材质、规格，热处理状态，并移植材质标记（不许打钢印）          1.2  封头坯料尺寸 -34×D1850'),(447,17,'2','数控切割','切割坯料外圆，切割前预热 120℃，割后清除熔渣，毛刺等，与R3041.02共带一块母材试板'),(448,17,'3','热压','对封头毛坯热压成形（外协）。'),(449,17,'4','热处理','封头进行恢复材料状态的正火热处理，注意与R3041.02同炉热处理，热处理后母材试板进行力学性能试验，实验结果确认合格后，将部分试板回厂，经复验合格后，再按图纸加工好坡口（外协）。剩余试板随封头回厂。'),(450,17,'5','检 查','5.1.封头表面凹凸量  -6～+12mm；5.2. 封头最小壁厚不得小于27.7mm；      5.3.封头主要尺寸允差见下表规定:大口内直径允差：-4～+5；总高度公差：-3～+4；大口外圆周长公差：-12～+15；大小口同心度：≤2mm。'),(451,17,'6','入 库','检验及试板性能合格后入库。');
